export default{
    state:{
        isCollapse:false,
        tabsList:[
        {
            path: '/data',
            name: 'data',
            label: '数据管理',
            icon: 's-data',
            url: 'Data/Data'
        },
        ]
    },
    mutations:{
        collapseMenu(state){
            state.isCollapse=!state.isCollapse
        },
        selectMenu(state,val){
            console.log(val,'val')
            if(val.name!=='indicator'){
                const index =state.tabsList.findIndex(item=>item.name === val.name)
                if(index===-1){
                    state.tabsList.push(val)
                }
            }
        }
    }
}
